// Formulario.js
import React, { useState } from 'react';

const Formulario = () => {
  const [nombre, setNombre] = useState('');
  const [edad, setEdad] = useState('');
  const [tienePropiedades, setTienePropiedades] = useState(false);
  const [primeraVez, setPrimeraVez] = useState(true);
  const [localidad, setLocalidad] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();

    // Aquí puedes enviar la información a la API o realizar las acciones necesarias.
    console.log('Nombre:', nombre);
    console.log('Edad:', edad);
    console.log('Tiene propiedades:', tienePropiedades);
    console.log('Primera vez:', primeraVez);
    console.log('Localidad:', localidad);

    // Puedes resetear el formulario después de enviar los datos si es necesario.
    // resetForm();
  };

  return (
    <form onSubmit={handleSubmit}>
      <label>
        Nombre:
        <input type="text" value={nombre} onChange={(e) => setNombre(e.target.value)} />
      </label>
      <br />

      <label>
        Edad:
        <input type="number" value={edad} onChange={(e) => setEdad(e.target.value)} />
      </label>
      <br />

      <label>
        ¿Tiene propiedades?
        <input type="checkbox" checked={tienePropiedades} onChange={() => setTienePropiedades(!tienePropiedades)} />
      </label>
      <br />

      <label>
        ¿Es la primera vez con aseguradoras de casas?
        <input type="checkbox" checked={primeraVez} onChange={() => setPrimeraVez(!primeraVez)} />
      </label>
      <br />

      <label>
        Localidad:
        <input type="text" value={localidad} onChange={(e) => setLocalidad(e.target.value)} />
      </label>
      <br />

      <button type="submit">Enviar</button>
    </form>
  );
};

export default Formulario;
